import React from 'react'
import employeeDropdown from './employeeDropdown'

const shiftList = ({events, employees}) => {
    <ul>
    {events.map((ev) =>
    <>
      <li>{ev.title}</li>
      <select>
        {employees.map((emp) =>
        <option value = {emp}>{emp}</option>
        )}
      </select>
    </>                                 
    )}
  </ul>
};
export default shiftList;
